window.bookSummaryJSON = "<p>Prepare yourself for the ultimate multicast performance. We've gathered many of Audible's most popular narrators to bring to life some of the most extraordinary words ever written. 19 words, in fact, carefully selected and arranged alphabetically as in their original source: the 11th edition of the <i>Encyclop√¶dia Britannica</i>. We created this enlightening journey from AUDIENCE to LITERATURE because you asked for it. You said you could listen to your favorite narrators read the phone book, bookcase assembly instructions, or a restaurant menu. With this production we've proven that a truly talented narrator can, in fact, take any work and make it extraordinary. Enjoy! </p><p>The full list of narrators includes: </p><p>Nick Podehl - AUDIENCE <br>CJ Critt - BLACKBALL <br>Kaleo Griffith - BLACKMAIL <br> Katherine Kellgren - BLUNDERBUSS <br>Kevin Pariseau - CHAOS <br>Tom Stechschulte - CHAPERON <br>Sebastian York - CHEESE <br>Cassandra Campbell - CHIC <br>Victor Bevine - COB <br>Eric Michael Summerer - DECOY <br>John Lee - ELIXIR <br>Sophie Eastlake - ENTHUSIASM <br>Therese Plummer - EPHEBEUM <br>Zachary Webber - EPISTAXIS <br>Peter Ganim - GERBIL <br>Luke Daniels - IMAGINATION <br>Eric Dove - IMITATION <br>Scott Brick - JEALOUSY <br>Gregory Salinas - LITERATURE </p><p><b>Please Note: This recording of the <i>Encyclopaedia Britannica</i> was Audible's 2016 April Fool's Joke. </b></p>"; 
